import React from "react";
import Navbar from "./components/Navbar";
import Banner from "./components/Banner";
import Sobre from "./components/Sobre";
import Equipe from "./components/Equipe";

function App() {
  return (
      <div>
          <Navbar />
          <Banner />
          <Sobre />
          <Equipe />
      </div>
  );
}

export default App;
